import React from "react";

const List = (props) => {
    const { contents } = props;
    for(var i=0; i<contents.length; i++){
        console.log(contents[i]);
    }
    if (!contents || contents.length === 0) return <h1>No hay peliculas</h1>

    return (
        <ul>
            <h2 className="Component-Title">Estas son las peliculas disponibles</h2>

            {contents.map((content) => {
                return (
                    <div style={{background: "yellow", margin: "10px"}}>
                        <li key={content.id}>

                            <span className="Component-Title"><b>Nombre:</b> {content.name}</span>
                            <span className="Component-Title"><b>Anno:</b> {content.year}</span>
                            <span className="Component-Title"><b>Director:</b>{content.toString()}</span>
                            <span className="Component-Title"><b>Nombre:</b></span>
                            <span className="Component-Title"><b>Apellido:</b></span>
                        </li>
                    </div>

                );
            })}
        </ul>
    );

};
export default List;
